import React, {Component} from 'react';

class Footer extends Component {

  render() {
    return(
      <footer className='footer'>
        <div className='container'>
          <div className='footer-row'>
            This is a footer
          </div>
        </div>
      </footer>
    );
  }
}

export default Footer;
